⁣
🚲Power+Flow, the heartchild of my talented friend @theKristinaGirod, has opened its doors for in-person spin classes!⁣
⁣
👩🏼‍💻As a business owner, I love seeing my friends launch their businesses. Foxy FIT is my baby, @BaptistePowerYogaPhoenix is Brian’s baby, Power+Flow is my favorite spin teacher’s baby!!⁣
⁣
😬When Kristina shared that she was opening a spin studio, half of me was thrilled—and half of me worried she was crazy!⁣
⁣
😥It’s been a difficult year to own a health and fitness company in Arizona. Fitness centers have recently reopened for the second time after being closed for business more than half of the year-to-date. ⁣
⁣
😷Opening a fitness studio in the midst of a global pandemic takes tremendous heart, huge faith + a giant passion to show up for others in times of crisis.⁣
⁣
💥Kristina is the perfect person to start + nurture this community💥⁣
⁣
She has a gift for ⁣
💥authentic sharing⁣
💥inspiring others to be their best⁣
💥connecting humans to build an inclusive, welcoming environment⁣
⁣
🚴🏼‍♀️Their mission is to provide a community-based training space where value is added through⁣
🤸🏼‍♀️Movement⁣
🤝Inclusion⁣
💦Sweat⁣
⁣
↪️Power+Flow offers in-person and online on-demand spin, strength, and recovery classes. It’s been incredible for me to have access to spin with Kristina at home, on my Peloton bike.⁣
⁣
‼️In fact, Kristina and I are cooking up a little surprise for you!! Make sure you’re subscribed to our newsletters or have notifications turned on for insta. You won’t want to miss our collaboration!⁣
⁣
🙏🏼Thank you for allowing me to share my excitement with you! You can read more on #lemonlovesblog — link in bio!⁣
⁣
💁🏼‍♀️I’d love to hear: what are you excited about today?⁣
⁣
👇🏼Share in the comments!👇🏼

